import React from 'react';

class News extends React.Component {
    constructor(props){
        super();
    }
    render () {
        const {
            name, 
            image,
            id, 
            status, 
            gender, 
            species, 
            origin,
            created,  
            location
        } = this.props.news;
        return(
            <div className="news">News</div>
        );
    }
}

export default News;
